import './ServicoAdm.css'
import '../AdmGlobal.css'
import NavAdm from '../../../Component/NavAdm/NavAdm'
import { useEffect, useState } from 'react'
import Axios from 'axios';
import { Link } from 'react-router-dom';


export default function AdmServicoGerencia()
{


  //const baseUrl = "http://34.133.121.3:8080"
  const baseUrl = "http://localhost:8080"
  const[APIData, setAPIData]= useState([]);
  const[dadoPesquisa, setdadoPesquisa] = useState('')
  const pesquisa = dadoPesquisa.length > 0 ?
  APIData.filter(dados => dados.nome.includes(dadoPesquisa)) :
  [];

  useEffect(() => {
    Axios
      .get(`${baseUrl}/servico/ListarServicos`)
      .then((response) => { setAPIData(response.data)}) 
      .catch((err) => {
        console.error("ops! ocorreu um erro" + err);
      });
  }, []);

    return(<>
        <div className="admBoxGeral">
                
                <div className="admBoxNav">
                    <NavAdm></NavAdm>
                </div>
                <div className='conteudoGeral'>
                           <div className='campoPesquisa'>
                              <label>Nome:<br/>
                              <input type="text" name="dadoPesquisacpf" className="inputPesquisa" onChange={e=> setdadoPesquisaCpf(e.target.value)} placeholder="Digite o Nome para busca" />
                              </label>
                           </div>
                           <div className='conteudoInterno'></div>
                      {APIData.map((data, i)=>{
                                return(<>

                                    <div className="Retorno"> 
                                          <div className="destaque">
                                          <div className="info">
                                             <span>{data.nome}</span><br/>
                                             <span> {data.valorFront}</span><br/>
                                          </div>
                                       </div>
                                       <div className="infoGeral">
                                       {data.nome}<br/>
                                      {data.descricao}<br/>
                                      {data.codigo}
                                      {data.valorFront}<br/>
                                      {data.maoDeObra}
                                       </div>
                                       <span><Link to={`/servicoeditar/${data.id}`}> Editar</Link></span> 

                                    </div>
                                </>)
                            })}
                          
                  </div>  
                </div>  
    </>)
}
